2 |  1.0000000 | 0.3427036 | 0.3828489 |\n| logINCOME |  0.1793354 |  0.3427036 | 1.0000000 | 0.4818427 |\n| logFACE |  0.2876115 |  0.3828489 | 0.4818427 | 1.0000000 |\n\n","text/latex":"A matrix: 4 × 4 of type dbl\n\\begin{tabular}{r|llll}\n  & NUMHH & EDUCATION & logINCOME & logFACE\\\\\n\\hline\n\tNUMHH &  1.0000000 & -0.0635292 & 0.1793354 & 0.2876115\\\\\n\tEDUCATION & -0.0635292 &  1.0000000 & 0.3427036 & 0.3828489\\\\\n\tlogINCOME &  0.1793354 &  0.3427036 & 1.0000000 & 0.4818427\\\\\n\tlogFACE &  0.2876115 &  0.3828489 & 0.4818427 & 1.0000000\\\\\n\\end{tabular}\n","text/plain":"          NUMHH      EDUCATION  logINCOME logFACE  \nNUMHH      1.0000000 -0.0635292 0.1793354 0.2876115\nEDUCATION -0.0635292  1.0000000 0.3427036 0.3828489\nlogINCOME  0.1793354  0.3427036 1.0000000 0.4818427\nlogFACE    0.2876115  0.3828489 0.4818427 1.0000000"},"metadata":{}}],"execution_count":19},{"cell_type":"markdown","source":"Next, we apply log transformations to all the money-type elements in the data set. We note that this transformation is also applied to other variables that fall outside the scope of this demonstration; these variables are included for consistency with the source calculations.","metadata":{}},{"cell_type":"code","source":"data <- data %>% mutate(logINCOME = log(INCOME),\n                logTOTINCOME = log(TOTINCOME),\n                logCHARITY = log(CHARITY),\n                logFACECVLIFEPOLICIES = log(FACECVLIFEPOLICIES),\n                logCASHCVLIFEPOLICIES = log(CASHCVLIFEPOLICIES),\n                logBORROWCVLIFEPOL = log(BORROWCVLIFEPOL),\n                logNETVALUE = log(NETVALUE))","metadata":{"execution":{"iopub.status.busy":"2024-10-17T15:35:31.759014Z","iopub.execute_input":"2024-10-17T15:35:31.760740Z","iopub.status.idle":"2024-10-17T15:35:31.778290Z"},"trusted":true},"outputs":[],"execution_count":22},{"cell_type":"markdown","source":"Visualisation techniques can be useful in exploring and gaining a better understanding of the data, and serves as a mechanism to communicate the results with other parties. We would typically use these techniques to explore the data and to identify elements to be explored in more detail, as in the preceding example. At a high level, we can conclude that there seems to be linear relationships between logFACE and logINCOME, and logFACE and logCHARITY. There also appears to be a quadratic relationship between logFACE and logTOTINCOME. There are no immediately apparent relationships between logFACE and the other variables.","metadata":{}},{"cell_type":"markdown","source":"**Categorical variables**\nNext, move to categorical variables. Since scatterplots are not suitable for categorical variables, blox plots are created to show the possible relationships between the logFACE variable and the GENDER, MARSTAT, ETHNICITY, SGENDER, and SMARSTAT variables.","metadata":{}},{"cell_type":"code","source":"par(mfrow=c(3,2))\nboxplot(logFACE ~ GENDER, data = data)\nboxplot(logFACE ~ MARSTAT, data = data)\nboxplot(logFACE ~ ETHNICITY, data = data)\nboxplot(logFACE ~ SGENDER, data = data)\nboxplot(logFACE ~ SMARSTAT, data = data)\n","metadata":{"execution":{"iopub.status.busy":"2024-10-17T15:37:41.725706Z","iopub.execute_input":"2024-10-17T15:37:41.727471Z","iopub.status.idle":"2024-10-17T15:37:41.853202Z"},"trusted":true},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXwTdf7H8UnTI22hpeWScl+CiwXkkioCtSi0tJVTQEFXAfECBH4Isgirghwq\nRVxlUXAF5V5ACraUWiquUFRAAWWBcst9H6UtbZP8/ohbK6QhTSfzzXzzej4e9NFMkplPJsOn\n78xkvmOwWq0KAAAA9M9HdAEAAABQB8EOAABAEgQ7AAAASRDsAAAAJEGwAwAAkATBDgAAQBIE\nOwAAAEkQ7AAAACRBsAMAAJAEwQ4AAEASBDsAAABJEOwAAAAkQbADAACQBMEOAABAEgQ7AAAA\nSRDsAAAAJEGwAwAAkATBDgAAQBIEOwAAAEkQ7AAAACRBsAMAAJAEwQ4AAEASBDsAAABJEOwA\nAAAkQbADAACQBMEOAABAEgQ7AAAASRDsAAAAJEGwAwAAkATBDgAAQBIEOwAAAEkQ7AAAACRB\nsAMAAJAEwQ4AAEASBDsAAABJEOwAAAAkQbADAACQBMEOAABAEgQ7AAAASRDsAAAAJEGwAwAA\nkATBDgAAQBIEOwAAAEk