,  p-value: < 2.2e-16\n"},"metadata":{}}],"execution_count":24},{"cell_type":"code","source":"# Obtain the Anova table\nanova(reg_model)","metadata":{"execution":{"iopub.status.busy":"2024-10-17T15:40:08.346982Z","iopub.execute_input":"2024-10-17T15:40:08.348924Z","iopub.status.idle":"2024-10-17T15:40:08.375794Z"},"trusted":true},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A anova: 4 × 5</caption>\n<thead>\n\t<tr><th></th><th scope=col>Df</th><th scope=col>Sum Sq</th><th scope=col>Mean Sq</th><th scope=col>F value</th><th scope=col>Pr(&gt;F)</th></tr>\n\t<tr><th></th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><th scope=row>logINCOME</th><td>  1</td><td>222.62925</td><td>222.629246</td><td>95.70075</td><td>1.497782e-19</td></tr>\n\t<tr><th scope=row>EDUCATION</th><td>  1</td><td> 51.50220</td><td> 51.502200</td><td>22.13905</td><td>4.047580e-06</td></tr>\n\t<tr><th scope=row>NUMHH</th><td>  1</td><td> 54.33593</td><td> 54.335931</td><td>23.35717</td><td>2.255708e-06</td></tr>\n\t<tr><th scope=row>Residuals</th><td>271</td><td>630.42897</td><td>  2.326306</td><td>      NA</td><td>          NA</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA anova: 4 × 5\n\n| <!--/--> | Df &lt;int&gt; | Sum Sq &lt;dbl&gt; | Mean Sq &lt;dbl&gt; | F value &lt;dbl&gt; | Pr(&gt;F) &lt;dbl&gt; |\n|---|---|---|---|---|---|\n| logINCOME |   1 | 222.62925 | 222.629246 | 95.70075 | 1.497782e-19 |\n| EDUCATION |   1 |  51.50220 |  51.502200 | 22.13905 | 4.047580e-06 |\n| NUMHH |   1 |  54.33593 |  54.335931 | 23.35717 | 2.255708e-06 |\n| Residuals | 271 | 630.42897 |   2.326306 |       NA |           NA |\n\n","text/latex":"A anova: 4 × 5\n\\begin{tabular}{r|lllll}\n  & Df & Sum Sq & Mean Sq & F value & Pr(>F)\\\\\n  & <int> & <dbl> & <dbl> & <dbl> & <dbl>\\\\\n\\hline\n\tlogINCOME &   1 & 222.62925